package basicConcept;

public class MultiArrays {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int a[][]= {{9,5},{8,7}};
		for(int i=0;i<2;i++)
		{
		  for(int j=0;j<2;j++)
		  {
			  System.out.print(a[i][j]+" ");
			 
		  }
		  System.out.println();
		}
		

	}

}
